import React, { Component } from 'react'

class Listing extends Component {
  render() {
    const listing = this.props;

    return (
      <div className='listing'>
      <div className="listingName">{listing.name}</div>
      <div className="listingPhoto">
        <img alt={listing.name + " photo"} src={listing.image_url}/></div>
        <ul className='listingDetails'>
          <li>{listing.display_phone}</li>
          <li><a href={`${listing.url}`}>See Yelp For More Information</a></li>
        </ul>
      </div>
    )
  }
}

export default Listing
